import { BrowserRouter, Route, Switch } from "react-router-dom";
import Coin from "./Coin";
import Coins from "./Coins";

interface IRouterProps {}
const Router = ({}: IRouterProps) => {
  return (
    <>
      <BrowserRouter>
        <Switch>
          <Route path="/">
            <Coin />
          </Route>
          <Route path="/:coinId">
            <Coins />
          </Route>
        </Switch>
      </BrowserRouter>
    </>
  );
};

export default Router;
